import React, { Component } from 'react';

class Articles extends Component {

    renderList = () => {
        const newLists = this.props.data.map((element, index) => {
          return (
            <div key = {index} className = "individualNewsList">
              <div>
                {element.title}
              </div>
              <div>
                {element.source.name} 
              </div>
              <div>
                {element.author}
              </div>
              <div>
                {element.publishedAt}
              </div>
            </div>);
        });

        return newLists;
    }

    render() {
        return (
            <div>
                jun
                {this.renderList()}
            </div>
        );
    }
}

export default Articles;
